    }

    pub fn view(self, context: &mut PrivateContext) {
        pack_arguments(self.args);
        context
            .call_private_function_with_packed_args(
                self.target_contract,
                self.selector,
                self.args_hash,
                true,
            )
            .assert_empty();
    }
}

